humbnail, Duration of YouTube &amp; Vimeo Videos<br />\n✔ Automatically Flush Facebook Thumbnails<br />\n✔ Open External Links in New Tabs<br />\n✔ Nofollow External Links<br />\n✔ <code>Noindex</code> Paginated, Archive, Search Result Pages<br />\n✔ Instant Indexing for Bing &amp; Yandex [Also Google using our <a href=\"https://rankmath.com/blog/google-indexing-api/\" rel=\"nofollow ugc\">Instant Indexing Plugin</a>]</p>\n<p><strong>WooCommerce SEO</strong><br />\n✔ Automatic Schema for WooCommerce Products<br />\n✔ Advanced Open Graph Tags for WooCommerce Products<br />\n✔ Automatic NoIndex Hidden Products<br />\n✔ Remove WooCommerce Product and Category Base<br />\n✔ Add Custom Brands to Products<br />\n✔ Add Global Identifier Schema Like GTIN/MPN – Even to Variations</p>\n<p><strong>MANY MORE FEATURES</strong><br />\n✔ PREMIUM 24x7x365 Dedicated Support Managers<br />\n✔ MOST COMPETITIVE PRICING EVER!</p>\n<p><strong><a href=\"https://rankmath.com/pricing/\" rel=\"nofollow ugc\">CHEK ALL THE PREMIUM FEATURES AND PRICING HERE</a></strong></p>\n<h3>CONNECT WITH THE TEAM AND SEO EXPERTS</h3>\n<p><strong><a href=\"https://www.facebook.com/groups/rankmathseopluginwordpress/?utm_campaign=Rank+Math\" rel=\"nofollow ugc\">JOIN FACEBOOK GROUP COMMUNITY</a></strong>: The purpose of this Facebook group is to have a collective place where the community can help each other, and we can get some feedback to improve Rank Math as well. Joining the group is also a great way to connect with like-minded people and share your SEO experience.</p>\n<h4>Branding Guideline</h4>\n<p>Rank Math® SEO is a registered trademark. Please use the following format when mentioning the Rank Math plugin anywhere.<br />\n* Rank Math [correct]<br />\n* RankMath [incorrect]<br />\n* Rankmath [incorrect]<br />\n* rankmath [incorrect]<br />\n* rankMath [incorrect]</p>\n<h4>Getting Started:</h4>\n<p><strong><a href=\"https://rankmath.com/kb/how-to-setup/?utm_source=LP&amp;utm_campaign=WP\" rel=\"nofollow ugc\">1. How to Setup Rank Math:</a></strong> Once you install Rank Math for the first time, you will be greeted with the Setup Wizard, which is discussed in detail here.</p>\n<p><strong><a href=\"https://rankmath.com/kb/wordpress/seo-suite/?utm_source=LP&amp;utm_campaign=WP\" rel=\"nofollow ugc\">2. User Documentation:</a></strong> Although Rank Math is already easy to set up, we&#8217;ve put together tutorials, guides, and some knowledge bases to help you set up and get started with Rank Math.</p>\n<p><strong><a href=\"https://translate.wordpress.org/projects/wp-plugins/seo-by-rank-math/?utm_campaign=Rank+Math\" rel=\"nofollow ugc\">3. Contribute (Sharing is caring):</a></strong> If you are one of those caring hearts that want to help, please check the following resources:<br />\n* <a href=\"https://github.com/RankMath/seo-by-rank-math/\" rel=\"nofollow ugc\">Rank Math&#8217;s GitHub repository</a> – Includes all the uncompressed files.<br />\n* <a href=\"https://github.com/rankmath/content-analyzer\" rel=\"nofollow ugc\">Content Analyzer Code Files</a> – Includes all supplementary uncompressed files.<br />\n* <a href=\"https://translate.wordpress.org/projects/wp-plugins/seo-by-rank-math/\" rel=\"nofollow ugc\">Translation</a> – If you want to translate the plugin into your local language.</p>\n<p><strong><a href=\"https://support.rankmath.com/?utm_source=LP&amp;utm_campaign=WP\" rel=\"nofollow ugc\">4. Support Ticket Forum:</a></strong> Our dedicated forum is where you can get support for any issues you face with Rank Math. In the forum, we&#8217;ll also try to answer some SEO queries. User experience is important to us, and we aim to answer all the forum queries promptly.</p>\n<p><strong><a href=\"#faq-header\" rel=\"nofollow ugc\">5. Frequently Asked Questions:</a></strong> Here, we’ve answered the most commonly asked questions about Rank Math. The questions are related to features, pricing, and others.</p>\n\";s:12:\"installation\";s:721:\"<ol>\n<li>Visit <code>Plugins &gt; Add New</code></li>\n<li>Search for <code>Rank Math</code></li>\n<li>Install Rank Math once it appears</li>\n<li>Activate Rank Math from your Plugins page.</li>\n<li>Go to &#8220;after activation&#8221; below.</li>\n</ol>\n<h4>Manually</h4>\n<ol>\n<li>Upload the <code>seo-by-rank-math</code> folder to the <code>/wp-content/plugins/</code> directory</li>\n<li>Activate the Rank Math plugin through the &#8216;Plugins&#8217; menu in WordPress</li>\n<li>Go to &#8220;after activation&#8221; below.</li>\n</ol>\n<h4>After Activation</h4>\n<ol>\n<li>You should see the Rank Math setup wizard. </li>\n<li>Go through the setup wizard and set up the plugin for your site. </li>\n<li>You’re done!</li>\n</ol>\n\";s:3:\"faq\";s:5521:\"\n<dt id=\'can%20i%20transfer%20my%20seo%20%26%20redirection%20settings%20from%20another%20plugin%20to%20rank%20math%3F\'>\nCan I transfer my SEO &amp; Redirection settings from another plugin to Rank Math?\n</h4>\n<p>\n<p>Absolutely. Rank Math has a built-in feature to import SEO settings from popular SEO plugins like Yoast SEO, Yoast SEO Premium, AIO SEO Pack, All In One Schema Rich Snippets, and Redirection. Once you install Rank Math and run the setup wizard, you&#8217;ll see a dedicated step where you&#8217;ll get to import all your SEO settings to Rank Math.</p>\n</p>\n<dt id=\'what%20themes%20does%20rank%20math%20support%3F\'>\nWhat themes does Rank Math support?\n</h4>\n<p>\n<p>Rank Math has been tested with many WordPress themes and supports all major WordPress themes. Since we follow WordPress plugin development guidelines, you can rest assured that Rank Math will work perfectly, no matter your theme. If you&#8217;ve installed Rank Math and are facing issues, it might not be because of theme incompatibility. Please contact the support team by opening a support ticket in our support forum, and we will fix it for you.</p>\n</p>\n<dt id=\'what%20plugins%20is%20rank%20math%20compatible%20with%3F\'>\nWhat plugins is Rank Math compatible with?\n</h4>\n<p>\n<p>Rank Math has been designed using WordPress&#8217; strict plugin development guidelines and, therefore, is compatible with most plugins. However, you might get unexpected results if you use another SEO plugin that performs any of the functions that Rank Math does. We recommend that you disable or delete other SEO plugins for best results.</p>\n</p>\n<dt id=\'will%20my%20website%20slow%20down%20if%20i%20install%20rank%20math%3F\'>\nWill my website slow down if I Install Rank Math?\n</h4>\n<p>\n<p>No. Rank Math&#8217;s code has been created and optimized for maximum performance. That is why using Rank Math on your website will not slow down your website. On the contrary, your website will perform better than ever with Rank Math, as it does the job of multiple plugins. Once you remove the unnecessary plugins from your website, your website&#8217;s performance is sure to get better.</p>\n</p>\n<dt id=\'is%20creating%20a%20rank%20math%20account%20needed%20to%20use%20the%20plugin%3F\'>\nIs creating a Rank Math account needed to use the plugin?\n</h4>\n<p>\n<p>Not at all. Creating a FREE Rank Math account is needed only to utilize our API, which allows you get automatic keyword suggestions from Google and run SEO Site Analysis inside WordPress. <a href=\"https://rankmath.com/kb/free-account-benefits/\" rel=\"nofollow ugc\">You can read more about that here.</a></p>\n</p>\n<dt id=\'will%20you%20set%20up%20rank%20math%20on%20my%20website%3F\'>\nWill you set up Rank Math on my website?\n</h4>\n<p>\n<p>Rank Math is pretty easy to set up on your website. Apart from detailed instructions on installing Rank Math on our website, we&#8217;ve built a user-friendly setup wizard that will help you set up and configure Rank Math ideally for your website. If you face any issues even after using the setup wizard, please get in touch with the support team by sending an email to support@rankmath.com</p>\n</p>\n<dt id=\'do%20i%20have%20to%20remove%20other%20seo%20plugins%20if%20i%20install%20rank%20math%3F\'>\nDo I have to remove other SEO plugins if I install Rank Math?\n</h4>\n<p>\n<p>That is recommended. Rank Math is designed to be an all-in-one SEO plugin that handles everything SEO-related. If you use other SEO plugins with Rank Math on your website, not only will the performance of your website be negatively affected, but both plugins working together can produce unexpected SEO results.</p>\n</p>\n<dt id=\'i%20already%20use%20an%20seo%20plugin.%20can%20i%20use%20rank%20math%20on%20top%20of%20that%20plugin%3F\'>\nI already use an SEO plugin. Can I use Rank Math on top of that plugin?\n</h4>\n<p>\n<p>You can, but we do not recommend it. Rank Math has all the functionalities you need in an SEO plugin. You can do that if you still prefer using another plugin for a specific feature. However, we recommend that you turn off that functionality of Rank Math to avoid potential conflicts/issues.</p>\n</p>\n<dt id=\'will%20i%20lose%20my%20rankings%20if%20i%20switch%20to%20rank%20math%3F\'>\nWill I lose my rankings if I switch to Rank Math?\n</h4>\n<p>\n<p>No, you won&#8217;t. When you install Rank Math, it will seamlessly import your settings from your current SEO plugin. Once the process is complete, the search engines won&#8217;t notice a change on your website.</p>\n<p>If you set up Rank Math from scratch, your search engine rankings will depend on how you configure it. But please be advised that Google and other search engines prefer good, helpful content over anything else.</p>\n</p>\n<dt id=\'can%20i%20use%20rank%20math%20on%20a%20wordpress.com%20website%3F\'>\nCan I use Rank Math on a WordPress.com website?\n</h4>\n<p>\n<p>Yes, as the plugin is provided through WordPress.org, it is available on WordPress.com as well. However, you might be required to opt for the business plan on WordPress.com.</p>\n<p>Google is almost never willing to index all the pages and images available on a site. The number of pages and images that get indexed is based on the site&#8217;s reputation and the quality of the content, among others.</p>\n</p>\n<dt id=\'i%20have%20further%20questions%3B%20how%20do%20i%20contact%20you%3F\'>\nI have further questions; how do I contact you?\n</h4>\n<p>\n<p>Please drop us an email at support@rankmath.com, and we will be more than happy to assist you.</p>\n</p>\n\n\";s:9:\"changelog\";s:1663:\"<h4>1.0.242 [Apr 10, 2025]</h4>\n<ul>\n<li>Improved: Moved <a href=\"https://rankmath.com/kb/rank-math-status-and-tools/\" rel=\"nofollow ugc\">Status &amp; Tools page</a> code to React to load blazing fast. We will gradually enhance the performance of other modules</li>\n<li>Fixed: Compatibility issues with WordPress 6.8</li>\n<li>Fixed: <a href=\"https://rankmath.com/kb/advanced-tab/#redirect\" rel=\"nofollow ugc\">Deleting Redirection from the Post screen</a> was not working after the last update</li>\n<li>Fixed: Editing Schema in <a href=\"https://rankmath.com/blog/elementor-seo/\" rel=\"nofollow ugc\">Elementor editor</a> was not working the second time after revisiting the Schema tab</li>\n<li>Fixed: PHP Deprecated warning on Sitemap page when <a href=\"https://rankmath.com/kb/configure-sitemaps/#authors\" rel=\"nofollow ugc\">Author sitemap</a> is enabled</li>\n<li>Fixed: Site URL was incorrectly logged in the <a href=\"https://rankmath.com/kb/monitor-404-errors/\" rel=\"nofollow ugc\">404 monitor</a> on some setups</li>\n<li>Fixed: Incorrect 404 title and description were used on the <code>sitemap_index.xml</code> page when Sitemap module was disabled</li>\n<li>Fixed: PHP warning regarding Translations loading too early on some setups</li>\n<li>Fixed: Missing <code>SEO Score</code> label on frontend when<a href=\"https://rankmath.com/kb/general-settings/#show-seo-score\" rel=\"nofollow ugc\"> Show SEO Score to Visitors option</a> is enabled</li>\n</ul>\n<p>Full changelog can be found here &#8211; <strong><a href=\"https://rankmath.com/changelog/?utm_source=Plugin&amp;utm_mediu